(function ($, Drupal) {

	'use strict';

    $(document).ready(function() {
        var eloqua_form = $('form.eloqua_form');

        eloqua_form.after("<div class='eloqua_loading' style='display:none;'>Submitting request...</div>");
        // Submit Eloqua subscripotion request through ajax.
        // Display success/error messages.
        eloqua_form.submit(function(){

		    $.ajax({
		      url: eloqua_form.attr('action'),
		      type: 'POST',
		      data : eloqua_form.serialize(),
		      beforeSend: function(){
		      	// disable submit button
	      	 	eloqua_form.find('input[type=submit]').attr("disabled", "disabled");
	      	 	// show loading indicator
		      	$('.eloqua_loading').show();
		      },
		      complete: function() {
		      	// enable submit button
	      	 	eloqua_form.find('input[type=submit]').removeAttr("disabled");
	      	 	// hide loading indicator
		      	$('.eloqua_loading').hide();
		      },
		      success: function(){
		      	alert("Subscription request successfully submitted.");
		      },
		      error: function(jqXHR, textStatus, errorThrown){
		        alert("There was an error submitting subscription request.");
		      },
		    });
		    return false;
		});
    });
})(jQuery, Drupal);
