jQuery( document ).ready( function($) {
    if (!String.prototype.endsWith) {
      /**
      * Polyfill endsWith for Internet Explorer.
      *
      * @param {string} search Characters to be searched for at end of string.
      * @param {integer} this_len Optional. Used as string length if provided.
      *
      * @returns {boolean} True if given characters are found at the end of string.
      */
      String.prototype.endsWith = function(search, this_len) {
        if (this_len === undefined || this_len > this.length) {
          this_len = this.length;
        }
        return this.substring(this_len - search.length, this_len) === search;
      }
    }

    /*var disclaimer = '<a href="https://www.fda.gov/AboutFDA/AboutThisWebsite/WebsitePolicies/Disclaimers/default.htm" class="ext-disclaimer"><span class="fa fa-external-link" aria-hidden="true"></span><span class="sr-only">External Link Disclaimer</span></a>';*/
    var disclaimer = "<a href=\"http://" + location.hostname + "/about-fda/website-policies/website-disclaimer\" class=\"ext-disclaimer\"><span class=\"fa fa-external-link\" aria-hidden=\"true\"></span><span class=\"sr-only\">External Link Disclaimer</span></a>";

    // no disclaimer on these classes
    var classesArr = ["lcds-share__btn", "no-disclaimer"];
    var classesLen = classesArr.length;

    // check if element has class in array
    var hasClass = function( $element ) {
      for ( let i = 0; i < classesLen; i++ ) {
        var flag = $element.hasClass( classesArr[i] );
        if ( flag == true ) {
          break;
        }
      }
      return flag;
    }

    // no disclaimer on these references
    var hrefArr = ["#", "mailto:", "javascript", "tel:"]
    var hrefLen = hrefArr.length;

    // check element's href attribute
    var isHREF = function ( $element ) {
      let hrefValue = $element.attr('href');

      if ( hrefValue === undefined ) {
        return true;
      }

      for ( let i = 0; i < hrefLen; i++ ) {
        let myReg = new RegExp( '^' + hrefArr[i], 'i' );
        var flag = myReg.test( hrefValue );
        if ( flag == true ) {
          break;
        }
      }
      return flag;
    }

    // Add external site disclaimer after all links, excluding 
    // Twitter tweet embed links, internal links, and government links.
    $('a').not('.twitter-tweet a').each(function() {
      let $el = $( this );

      let govLink = ( this.hostname.endsWith('.gov') ) || ( this.hostname == location.hostname );
      if ( govLink == true) {
        return true;
      }

      if ( hasClass( $el )) {
        return true;
      }

      if ( isHREF( $el )) {
        return true;
      }

      $el.after(disclaimer);
    });
});
